<script>
export default {
  beforeRouteLeave(to, from, next) {
    this.$store.commit('viewtrack/setCurrentPageFluid', this.prevFluid)

    this.$nextTick(next)
  },
  data() {
    return { prevFluid: false }
  },
  computed: {
    authUserHome() {
      return this.$auth.user?.properties?.home || '/'
    },
    stateCurrentPageFluid() {
      return this.$store.state.viewtrack.currentPage?.properties?.fluid
    },
  },
  async mounted() {
    await this.$nextTick()

    this.prevFluid = this.stateCurrentPageFluid

    this.$store.commit('viewtrack/setCurrentPageFluid', true)
  },
  methods: {
    async onClickBack($event) {
      $event.preventDefault()

      this.$router.go(-2)
    },
    async onClickHome($event) {
      $event.preventDefault()

      this.$router.push({ path: this.authUserHome })
    },
  },
}
</script>

